import "./App.css";
import "./QuizPage.css";

function QuizPage() {
  return (
    <div>
      <header className="App-header">Quiz 1</header>
      <p className="QuizPage-main">
        Select the correct answer for each question. Submit your answers by
        clicking the "Submit Answers" button.
      </p>
      <div class="flex-container">
        <div>
          <div>Question 1</div>
          <div>Answer 1</div>
          <div>Answer 2</div>
          <div>Answer 3</div>
          <div>Answer 4</div>
        </div>
        <div>Question 2</div>
        <div>Question 3</div>
      </div>
      <p className="footer">This is the Footer</p>
    </div>
  );
}

export default QuizPage;
